import { useState } from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css"
import axios from 'axios';


function Register() {

    var [firstNameError, setFirstNameError] = useState("")
    var [lastNameError, setLastNameError] = useState("")
    var [emailError, setEmailError] = useState("");
    var [mobileNoError, setMobileNoError] = useState("");
    var [passwordError, setPasswordError] = useState("");
    var [userTypeError, setUserTypeError] = useState("");

    const [user, setUser] = useState({ firstName: " ", lastName: " ", email: " ", password: "", mobileNo: "", userType: " " });



    const url = "http://127.0.0.1:9999/register";

    const OnTextChage = (args) => {
        var copyOfUser = { ...user };
        copyOfUser[args.target.name] = args.target.value;
        setUser(copyOfUser);
    }


    const Validate = () => {
        //initially set to empty 
        // setFirstName("");
        // setLastName("");
        // setEmail(" ");
        // setPassword("");
        // setEmailError("");
        // setPasswordError("");
        // setMobileNoError(" ");
        // setUserType("");

        if (user.firstName === "") {
            setFirstNameError("*Please Enter Your Email")

        }
        if (user.lastName === "") {
            setLastNameError("*Please Enter Your Email")

        }
        if (user.mobileNo === "") {
            setEmailError("*Please Enter Your Email")

        }
        if (user.email === "") {
            setEmailError("*Please Enter Your Email")

        }
        if (!/^[\w-\.]+@([\w-]+\.)+[\w-]{2,4}$/.test(user.email)) {
            setEmailError("*Please enter a valid email")

        }
        if ("" === user.password) {
            setPasswordError("*Please Enter your Password");
        }
        if (user.password.length < 8) {
            setPasswordError("*Password must be  8 characters or Longer");

        }
    };


    return (
        <div className="container">
            <center>
                <br />
                <br />
                <br />
                <br />
                <form>
                    <h1 className="text-primary"> REGISTER NEW USER </h1>
                    <div class="table-responsive">
                        <table class="table">
                            <tbody>
                                <tr>
                                    <td>First Name:</td>
                                    <td><input type="text" value={user.firstName} onChange={OnTextChage} /> </td>
                                    <td className="text-danger">{firstNameError}</td>
                                </tr>
                                <tr>
                                    <td>Last Name:</td>
                                    <td> <input type="text" value={user.lastName} onChange={OnTextChage} /> </td>
                                    <td className="text-danger">{lastNameError}</td>
                                </tr>
                                <tr>
                                    <td> Email: </td>
                                    <td><input type="email" value={user.email} onChange={OnTextChage} /></td>
                                    <td  className="text-danger" >{emailError}</td>
                                </tr>
                                <tr>
                                    <td>Password:</td>
                                    <td> <input type="password" value={user.password} onChange={OnTextChage} /> </td>
                                    <td className="text-danger"> {passwordError} </td>
                                </tr>
                                <tr>
                                    <td>Mobile Number:</td>
                                    <td><input type="tel" value={user.mobileNo} onChange={OnTextChage} /> </td>
                                    <td className="text-danger">{mobileNoError} </td>
                                </tr>
                                <tr>
                                    <td>UserType:</td>
                                    <td><select value={user.userType} onChange={OnTextChage}>
                                        <option value="0">Owner</option>
                                        <option value="1">Customer</option>
                                    </select>
                                    </td>
                                    <td className="text-danger" width="300px">{userTypeError} </td>
                                </tr>
                            </tbody>
                        </table>
                    </div>
                    <br />
                    <br />
                    <button className="btn btn-primary" onClick={Validate}> Register</button>
                </form>
            </center>
        </div>
    );
}

export default Register;
